import React, { Component } from "react";
import artistImage from "../../../Assets/image/sliderImage/1.jpg";
export default class ArtistDetails extends Component {
  render() {
    return (
      <div className="row section text-centre text-md-left">
        <div className="col-xl-3 col-lg-4 col-sm-5">
          <img
            src={artistImage}
            alt="artist-image"
            className="card-img--radius-lg"
          />
        </div>
      </div>
    );
  }
}
